const App = () => {
  return (
    <div className="App">
      <InlineWidget url="https://calendly.com/your_scheduling_page" />
    </div>
  );
};

function LifeCoachingPage() {
  return;
  <div className="App">
    <InlineWidget url="https://calendly.com/your_scheduling_page" />
  </div>;
}

export default LifeCoachingPage;
